- uid: Metalama.Framework.Code.AccessibilityExtensions.IsSupersetOf(Metalama.Framework.Code.Accessibility,Metalama.Framework.Code.Accessibility)
  commentId: M:Metalama.Framework.Code.AccessibilityExtensions.IsSupersetOf(Metalama.Framework.Code.Accessibility,Metalama.Framework.Code.Accessibility)
