  type: Method
  assemblies:
  - Metalama.Framework
  namespace: Metalama.Framework.Code
  summary: Returns whether the left accessibility is strictly less restrictive than the right accessibility.
  example:
  - >-
    For example, <code>a.IsSupersetOf(Accessibility.Protected)</code> returns <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/builtin-types/bool">true</a> for <code>a</code> being

    <xref href="Metalama.Framework.Code.Accessibility.ProtectedInternal" data-throw-if-not-resolved="false"></xref> or <xref href="Metalama.Framework.Code.Accessibility.Public" data-throw-if-not-resolved="false"></xref>.
  syntax:
    content: public static bool IsSupersetOf(this Accessibility left, Accessibility right)
    parameters:
    - id: left
      type: Metalama.Framework.Code.Accessibility
      description: The accessibility level to compare.
    - id: right
      type: Metalama.Framework.Code.Accessibility
      description: The accessibility level to compare against.
    return:
      type: System.Boolean
      description: <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/builtin-types/bool">true</a> if <code class="paramref">left</code> is strictly less restrictive than <code class="paramref">right</code>; otherwise, <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/builtin-types/bool">false</a>.
    content.vb: Public Shared Function IsSupersetOf(left As Accessibility, right As Accessibility) As Boolean
  overload: Metalama.Framework.Code.AccessibilityExtensions.IsSupersetOf*
